import styles from './Navbar.module.css'
import NavbarBrand from "./NavbarBrand";
import NavbarLinks from "./NavbarLinks";

const Navbar = () => {
    return <nav className={styles['navbar']}>
        <NavbarBrand/>
        <NavbarLinks/>
    </nav>
}
export default Navbar;
